function SendPacket(idx)
{
    var packet = new Array(91).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x3F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x47;
    packet[7] = 0x0F;
    packet[8] = 0x03;
    packet[11] = idx;
    packet[13] = 0x15;

    
    for(var iIdx = 0; iIdx < 22; iIdx++){
        var col = device.color(iIdx,idx);
        var iLedIdx = (iIdx*3) + 14;
        packet[iLedIdx] = col[0]; //0; //0xF7;
        packet[iLedIdx+1] = col[1]; //0;
        packet[iLedIdx+2] = col[2]; //255;
    }

    packet[89] = CalculateCrc(packet);
    device.send_report(packet, 91);    
    device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.
}

function Apply()
{
    var packet = new Array(91).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x3F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x0C;
    packet[7] = 0x0F;
    packet[8] = 0x02;
    packet[9] = 0x00;
    packet[10] = 0x00;
    packet[11] = 0x08;
    
    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
}


export function Render()
{                
    SendPacket(0);   
    SendPacket(1);  
    SendPacket(2);
    SendPacket(3);    
    SendPacket(4);   
    SendPacket(5);          
    Apply();
        
    
}


